import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

function AdminHome() {

  const history=useHistory();
  const [hospitalDetails,sethospitalDetails]=useState([{
    hospitalName : "",
    hospitalInfo: "",
    addressLineOne: "",
    addressLineTwo: "",
    email: "",
    mobNumber: "",
    password: "",
    imagePath: "",
    id: 0,
    workingDays: 0
  }]);

  const Home=()=>{
    history.push("/");
}
const aboutProgress=()=>{

}
const addHospital=()=>{
  history.push("/AddHospital");
}

const Logout=()=>{
  sessionStorage.removeItem("userName");
  history.push("/");
}

useEffect(()=>{
  var helper=new XMLHttpRequest;
  helper.onreadystatechange=()=>{
      if(helper.readyState==4&&helper.status==200){
          var data=JSON.parse(helper.responseText);     
          console.log(data);
          sethospitalDetails(data);
      }
  };
  helper.open('GET','http://localhost:7070/hospital');
  helper.setRequestHeader("Content-Type","application/json");
  helper.send();
},[]);

    return ( 
        <>
            <nav class="navbar navbar-expand-lg bg-body-tertiary rounded" aria-label="Thirteenth navbar example">
      <div class="container-fluid">
        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarsExample11" aria-controls="navbarsExample11" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse d-lg-flex" id="navbarsExample11">
          <a class="navbar-brand col-lg-1 me-0" href="#"><h2>Welcome Master</h2></a>
          <a class="navbar-brand col-lg-2 me-0" style={{textAlign:'center'}} href="#"></a>
          <ul class="navbar-nav col-lg-6 justify-content-lg-center">
            <li class="nav-item">
                <div class="nav-link active btn" aria-current="page" onClick={Home}>Home</div>
              {/* <a class="nav-link active" aria-current="page" href="#">Home</a> */}
            </li>


            <li class="nav-item" style={{marginLeft:20}}>
            <div class="nav-link active btn" aria-current="page" onClick={aboutProgress}>Progress</div>
              {/* <a class="nav-link disabled">Update Profile</a> */}
            </li>
            <li class="nav-item" style={{marginLeft:20}}>
            <div class="nav-link active btn" aria-current="page" onClick={addHospital}>Add New Hospital</div>
              {/* <a class="nav-link disabled">Update Profile</a> */}
            </li>

            <li class="nav-item"></li>
          </ul>
          <div class="d-lg-flex col-lg-3 justify-content-lg-end">
            <button class="btn btn-primary" onClick={Logout}>LogOut</button>
          </div>
        </div>
      </div>
    </nav>

    <div className="container" style={{marginTop:20}}>
    <table class="table text-center">
  <thead>
    <tr>
      <th scope="col">sr no</th>

      <th scope="col">Doctor Name</th>
      <th scope="col">Patient Name </th>
      <th scope="col">diseases</th>
      <th scope="col">Date</th>
      <th scope="col">Status</th>
      <th scope="col" colSpan={2}>Actions</th>
    </tr>
  </thead>
  <tbody>
      {
        appointments.map((appointment,i)=>{
          if (appointment.status=='CANCELLED') {
            return <>
            <tr>
              <th scope="row">{i+1}</th>

              <td>{appointment.doctorName}</td>
              <td>{appointment.patientName}</td>
              <td>{appointment.diseases}</td>
              <td>{appointment.startDate}</td>
              <td>{appointment.status}</td>
              <td class="nav-item" style={{marginLeft:20}}> 
                    <div class="nav-link active " aria-current="page">Cancelled</div>
              </td>
          </tr>
            </>

          } else

          if(appointment.status=='DONE'){
            return <>
          <tr>
              <th scope="row">{i+1}</th>

              <td>{appointment.doctorName}</td>
              <td>{appointment.patientName}</td>
              <td>{appointment.diseases}</td>
              <td>{appointment.startDate}</td>
              <td>{appointment.status}</td>
              <td class="nav-item" style={{marginLeft:20}}> 
                    <div class="nav-link active btn btn-success" aria-current="page" onClick={()=>{viewReciept(appointment.id)}}>View Reciept</div>
              </td>
          </tr>
          </>
          }
          else if(appointment.status==='PENDING'){
          return <>
          <tr>
              <th scope="row">{i+1}</th>

              <td>{appointment.doctorName}</td>
              <td>{appointment.patientName}</td>
              <td>{appointment.diseases}</td>
              <td>{appointment.startDate}</td>
              <td>{appointment.status}</td>
              <td class="nav-item" style={{marginLeft:20}}> 
                    <div class="nav-link active btn btn-warning" aria-current="page">Cancel</div>
              </td>
          </tr>
          </>}
        })

      }
  </tbody>
</table>
    </div>

        </>
     );
}

export default AdminHome;
